import React from "react";
import data from "../data";

function ProductScreen() {
  const product = data.product.find();
  return (
    <div className="row">
      <div className="col-2">
        <img src={product.images} alt={product.name} />
      </div>
      <div className="col-1"></div>
      <div className="col-1"></div>
    </div>
  );
}

export default ProductScreen;
